import PropTypes from 'prop-types';
import Column from './Column/Column';

const Table = props => {
    const { children, dataSource, ...tableProps } = props;

    return (
        <div className='flex-row px-5 py-8'>
            <div className='-my-2 overflow-x-auto sm:-mx-6 lg:-mx-8'>
                <div className='py-2 align-middle inline-block min-w-full sm:px-6 lg:px-8'>
                    <div className='shadow overflow-hidden border-b border-gray-200 sm:rounded-lg'>{children}</div>
                </div>
            </div>
        </div>
    );
};

Table.propTypes = {};

Table.Column = Column;

export default Table;
